# Information about Wolfram Language Named Characters.
# See https://reference.wolfram.com/language/tutorial/InputAndOutputInNotebooks.html#4718

# Heuristics to consider in adding a Named Character.
# ===================================================

# 1. Unicode symbols used by Mathematica that are not in the Unicode Private Use Area are the same in Mathics3
# 2. Unicode symbols that correspond semantically with existing mathematical symbols are included. Example: − (U+2212, "Minus Sign")
#    is an alias for ASCII - even though Mathematica does not consider it so.
# 3. Unicode symbols outside of the Mathematical Operators Block (and the ASCII block) should be excluded unless one of the previous
#    heuristics includes it. Example: ✕ (U+2715, "Multiplication X") can be used for Times but is in the Dingbats Block and is thus excluded.
# 4. All typographical variants of "plain"/"regular" symbols are be excluded unless included by a previous heuristic.
#    For example, all Full Width variants, bold variants, italic variants, and so forth are excluded.
#
# Field definitions
# =================
#
#   amslatex: If present, the AMSLaTeX name of the symbol. AMSLaTeX symbols
#             are a superset of normal LaTeX symbols. If the replacement
#             is surrounded in "$" then this symbol can only be used in
#             Math mode.
#
#   ascii: If present, the ASCII equivalent. In some cases this may be more
#          than one character. For example "->" or "===".
#
#   esc-alias: The ESC sequence alias of the named character, if it exists.
#
#   has-unicode-inverse: Whether or not this named character has a unicode
#                        equivalent that should replace other variants of it,
#                        e.g. named character or ascii equivalent.
#
#   is-builtin-constant: If present, a boolean whether this is a Builtin Symbol as
#                        defined by WMA that acts like a constant (or a nullary function).
#                        Degree, I, Infinity, and PI are some examples such constants.
#                        Usually, if this field is present it will be "true"; for "false"
 #                       values (the majority), the field is omitted.
#
#
#   is-letter-like: Whether or not this named-character is "letter-like", or
#                   can be used as part of a symbol. For example \[alpha]
#                   is letter-like. Therefore we can write: \[alpha]5 = "testing"
#
#   operator-name: If present, this symbol is a Mathics operator with
#                  whose class name is the given name. For example, the
#                  Divide operator, "/" is here.  But some symbols like
#                  "`" or "." inside a number could be considered
#                  either an operator or as part of a lexical symbol.
#                  "operators.yml" may contain use these symbols, while here we
#                  might not (or we might). Also, from an operator
#                  prespective, an operator name like "Association"
#                  might have *two* (bracketing) symbols associated
#                  here: "LeftAssociation" and "RightAssociation".
#                  More operator information can be found in
#                  file "operators.yml".
#
#
#   unicode-equivalent: A unicode equivalent for the named-character, if it
#                       exists. If it is the same as "ascii", please omit.
#
#   unicode-equivalent-name: The name of the unicode equivalent, if it exists.
#                            The Python module unicodedata contains a list of
#                            unicode names that we check against. So if the character
#                            or unicode symbol is not in that, don't use it here.
#
#   wl-reference: HTML link to the Wolfram Langauge & System document for character.
#
#   wl-unicode: The unicode code point used by Mathics internally to represent
#               the named character. If it is the same as unicode-equivalent
#               it should be omitted
#
#   wl-unicode-name: The name of the character corresponding to `wl-unicode`, if it exists.
#                    It will mentioned in Wolfram Language docs if it exists.
#
# Sources:
#   https://www.compart.com/en/unicode
#   http://milde.users.sourceforge.net/LUCR/Math/unimathsymbols.pdf
#   https://reference.wolfram.com/language/ref/character/....html
#   https://github.com/rsmenon/pygments-mathematica
#   https://reference.wolfram.com/language/tutorial/OperatorInputForms.html

